from typing import List

from typing import List
from math import ceil, log2


class SegmentTree:
    def __init__(self, nums):
        self.n = len(nums)
        # Height of segment tree
        self.height = ceil(log2(self.n))
        # Maximum size of segment tree
        self.max_size = 2 * (2 ** self.height) - 1
        # Initialize segment tree arrays
        self.sum_tree = [0] * self.max_size  # For range sum
        self.max_sum_tree = [float('-inf')] * self.max_size  # For max subarray sum
        self.prefix_sum_tree = [float('-inf')] * self.max_size  # For max prefix sum
        self.suffix_sum_tree = [float('-inf')] * self.max_size  # For max suffix sum

        # Build the segment tree
        self._build_tree(nums, 0, 0, self.n - 1)

    def _build_tree(self, nums, index, start, end):
        # If there is only one element in the range
        if start == end:
            self.sum_tree[index] = nums[start]
            self.max_sum_tree[index] = nums[start]
            self.prefix_sum_tree[index] = nums[start]
            self.suffix_sum_tree[index] = nums[start]
            return

        mid = (start + end) // 2
        left_child = 2 * index + 1
        right_child = 2 * index + 2

        # Recursively build left and right subtrees
        self._build_tree(nums, left_child, start, mid)
        self._build_tree(nums, right_child, mid + 1, end)

        # Combine results from left and right children
        self.sum_tree[index] = self.sum_tree[left_child] + self.sum_tree[right_child]

        # Update prefix sum
        self.prefix_sum_tree[index] = max(
            self.prefix_sum_tree[left_child],
            self.sum_tree[left_child] + self.prefix_sum_tree[right_child]
        )

        # Update suffix sum
        self.suffix_sum_tree[index] = max(
            self.suffix_sum_tree[right_child],
            self.sum_tree[right_child] + self.suffix_sum_tree[left_child]
        )

        # Update max subarray sum
        self.max_sum_tree[index] = max(
            self.max_sum_tree[left_child],  # Max sum in left
            self.max_sum_tree[right_child],  # Max sum in right
            self.suffix_sum_tree[left_child] + self.prefix_sum_tree[right_child]  # Cross sum
        )

    def get_max_subarray_sum(self, query_start, query_end):
        return self._query_max_sum(0, 0, self.n - 1, query_start, query_end)

    def _query_max_sum(self, index, start, end, query_start, query_end):
        # If range is completely outside
        if start > query_end or end < query_start:
            return float('-inf')

        # If range is completely inside
        if query_start <= start and query_end >= end:
            return self.max_sum_tree[index]

        mid = (start + end) // 2
        left_child = 2 * index + 1
        right_child = 2 * index + 2

        # Get results from left and right subtrees
        left_sum = self._query_max_sum(left_child, start, mid, query_start, query_end)
        right_sum = self._query_max_sum(right_child, mid + 1, end, query_start, query_end)

        # If query range spans both subtrees
        if query_start <= mid and query_end > mid:
            cross_sum = (self._query_suffix_sum(left_child, start, mid, query_start, mid) +
                         self._query_prefix_sum(right_child, mid + 1, end, mid + 1, query_end))
            return max(left_sum, right_sum, cross_sum)

        return max(left_sum, right_sum)

    def _query_prefix_sum(self, index, start, end, query_start, query_end):
        if start > query_end or end < query_start:
            return float('-inf')
        if query_start <= start and query_end >= end:
            return self.prefix_sum_tree[index]

        mid = (start + end) // 2
        left_child = 2 * index + 1
        right_child = 2 * index + 2

        left_prefix = self._query_prefix_sum(left_child, start, mid, query_start, query_end)
        right_prefix = self._query_prefix_sum(right_child, mid + 1, end, query_start, query_end)
        left_sum = self._query_sum(left_child, start, mid, query_start, query_end)

        if query_start <= mid:
            return max(left_prefix, left_sum + right_prefix)
        return right_prefix

    def _query_suffix_sum(self, index, start, end, query_start, query_end):
        if start > query_end or end < query_start:
            return float('-inf')
        if query_start <= start and query_end >= end:
            return self.suffix_sum_tree[index]

        mid = (start + end) // 2
        left_child = 2 * index + 1
        right_child = 2 * index + 2

        left_suffix = self._query_suffix_sum(left_child, start, mid, query_start, query_end)
        right_suffix = self._query_suffix_sum(right_child, mid + 1, end, query_start, query_end)
        right_sum = self._query_sum(right_child, mid + 1, end, query_start, query_end)

        if query_end > mid:
            return max(right_suffix, right_sum + left_suffix)
        return left_suffix

    def _query_sum(self, index, start, end, query_start, query_end):
        if start > query_end or end < query_start:
            return 0
        if query_start <= start and query_end >= end:
            return self.sum_tree[index]

        mid = (start + end) // 2
        left_child = 2 * index + 1
        right_child = 2 * index + 2

        return (self._query_sum(left_child, start, mid, query_start, query_end) +
                self._query_sum(right_child, mid + 1, end, query_start, query_end))


class Solution:
    def maxSubarraySum(self, nums: List[int]) -> int:
        n = len(nums)
        if n == 1:
            return nums[0]

        # Build initial segment tree
        segment_tree = SegmentTree(nums)
        max_sum = segment_tree.get_max_subarray_sum(0, n - 1)

        # Try removing each unique number
        num_positions = {}
        for i, num in enumerate(nums):
            if num not in num_positions:
                num_positions[num] = []
            num_positions[num].append(i)

        # For each unique number
        for num, positions in num_positions.items():
            if len(positions) == n:  # Skip if removing would make array empty
                continue

            # Create ranges that exclude the positions of the current number
            ranges = []
            start = 0
            for pos in positions:
                if pos > start:
                    ranges.append((start, pos - 1))
                start = pos + 1
            if start < n:
                ranges.append((start, n - 1))

            # Find max subarray sum across all valid ranges
            local_max = float('-inf')
            for range_start, range_end in ranges:
                local_max = max(local_max, segment_tree.get_max_subarray_sum(range_start, range_end))

                # Try combining non-adjacent ranges
                for other_start, other_end in ranges:
                    if other_start > range_end + 1:
                        combined_sum = segment_tree.get_max_subarray_sum(range_start, range_end) + \
                                       segment_tree.get_max_subarray_sum(other_start, other_end)
                        local_max = max(local_max, combined_sum)

            max_sum = max(max_sum, local_max)

        return max_sum

